package Practice;

public class Over {
	static int add(int a,int b) {
		return a+b;
	}
	static int add(int a,int b,int c)
	{
		return a+b+c;
	}
	public static void main(String[] args) {
		// TODO Auto-generated method stub
           System.out.println(Over.add(4, 67));
           System.out.println(Over.add(65,54));
	}

}
